                      local plr = game:GetService("Players").LocalPlayer
local tweenService = game:GetService("TweenService")

local gui = Instance.new("ScreenGui", plr:WaitForChild("PlayerGui"))
gui.Name = "PetDuperGUI"
gui.ResetOnSpawn = false

local frame = Instance.new("Frame", gui)
frame.Size = UDim2.new(0, 200, 0, 120)
frame.Position = UDim2.new(0.5, -100, 0.5, -60)
frame.BackgroundColor3 = Color3.fromRGB(30, 30, 30)
frame.BorderSizePixel = 0
frame.Active = true
frame.Draggable = true

local corner = Instance.new("UICorner", frame)
corner.CornerRadius = UDim.new(0, 8)

local title = Instance.new("TextLabel", frame)
title.Size = UDim2.new(1, 0, 0, 30)
title.BackgroundTransparency = 1
title.Font = Enum.Font.GothamBold
title.TextSize = 16
title.TextColor3 = Color3.fromRGB(255, 255, 255)
title.Text = "Tools | Pet duper"

local button = Instance.new("TextButton", frame)
button.Size = UDim2.new(0.8, 0, 0, 35)
button.Position = UDim2.new(0.1, 0, 0, 60)
button.BackgroundColor3 = Color3.fromRGB(255, 140, 0)
button.Font = Enum.Font.GothamBold
button.TextSize = 18
button.TextColor3 = Color3.new(1, 1, 1)
button.Text = "Dupe"

local btnCorner = Instance.new("UICorner", button)
btnCorner.CornerRadius = UDim.new(0, 8)

frame.BackgroundTransparency = 1
tweenService:Create(frame, TweenInfo.new(0.4), {BackgroundTransparency = 0}):Play()

local function getEquippedTools(char)
	local list = {}
	for _, child in ipairs(char:GetChildren()) do
		if child:IsA("Tool") then
			table.insert(list, child)
		end
	end
	return list
end

local function tryPlayAnimation(model)
	if model:FindFirstChildWhichIsA("Humanoid") then
		for _, anim in pairs(model:GetDescendants()) do
			if anim:IsA("Animation") then
				local track = model.Humanoid:LoadAnimation(anim)
				track:Play()
				break
			end
		end
	elseif model:FindFirstChildWhichIsA("AnimationController") then
		local controller = model:FindFirstChildWhichIsA("AnimationController")
		for _, anim in pairs(model:GetDescendants()) do
			if anim:IsA("Animation") then
				local track = controller:LoadAnimation(anim)
				track:Play()
				break
			end
		end
	end
end

button.MouseButton1Click:Connect(function()
	local char = plr.Character or plr.CharacterAdded:Wait()
	for _, tool in ipairs(getEquippedTools(char)) do
		local clone = tool:Clone()
		clone.Parent = char

		-- Try to play animations
		tryPlayAnimation(clone)
	end
end)
                      
